import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Students from './components/Students';
import Login from './components/Login';
import { BrowserRouter, Route, Routes } from 'react-router-dom';




function App() {
  return (
    < BrowserRouter>
    <Routes>
      <Route path='/'>
        <Login/>
      </Route>
    </Routes>
  </ BrowserRouter>

  );
}

export default App;
